let simple_testbench (sim : Harness.Sim.t) =
  let inputs = Cyclesim.inputs sim in
  let outputs = Cyclesim.outputs sim in
  let cycle ?n () = Cyclesim.cycle ?n sim in

  (* Reset *)
  cycle();
  inputs.rst := Bits.vdd;
  cycle ();
  inputs.rst := Bits.gnd;
  cycle ();

  (* Apply inputs, one per cycle, and sample outputs throughout *)
  let observed_pos = ref [] in
  let observed_zero = ref [] in
  let observed_crossings = ref [] in
  
  List.iteri tv_in ~f:(fun i v ->
    inputs.in_data <--. v;
    inputs.dir_r := if List.nth_exn tv_dir_in i = 1 then Bits.vdd else Bits.gnd;
    observed_pos := !observed_pos @ [ Bits.to_unsigned_int !(outputs.curr_pos_op) ];
    observed_zero := !observed_zero @ [ Bits.to_unsigned_int !(outputs.zero_count) ];
    observed_crossings := !observed_crossings @ [ Bits.to_unsigned_int !(outputs.zero_crossings) ];
    cycle ()
  );

  (* Allow pipeline to flush so that we don't get erroneous values *)
  inputs.in_data <--. 0;
  for _ = 1 to 10 do
    observed_pos := !observed_pos @ [ Bits.to_unsigned_int !(outputs.curr_pos_op) ];
    observed_zero := !observed_zero @ [ Bits.to_unsigned_int !(outputs.zero_count) ];
    observed_crossings := !observed_crossings @ [ Bits.to_unsigned_int !(outputs.zero_crossings) ];
    cycle ()
  done;

  (* Print all observations *)
  Stdio.printf "Cycle | Input     | Position | Zero Count | Zero Crossings\n";
  Stdio.printf "----------------------------------------------------------------\n";
  List.iteri !observed_pos ~f:(fun i pos ->
    let input_val = if i < List.length tv_in then List.nth_exn tv_in i else 0 in
    let zero_cnt = List.nth_exn !observed_zero i in
    let crossings = List.nth_exn !observed_crossings i in
    Stdio.printf "%5d | %9d | %8d | %10d | %14d\n" i input_val pos zero_cnt crossings
  )
;;

